def particle_ini(p,minDist):


    for j in range(m):
        p[j]=random.uniform(xmin, xmax)
        p[j+m]=random.uniform(ymin,ymax)



    Constraint_OK=False

    while Constraint_OK ==False:
        count=0
        for j in range(m-1): 
            for k in range(j+1,m): 
                ppp = p[j+m]-p[k+m]
                qqq = p[j]-p[k]
                if ppp**2+qqq**2 > minDist:
                    count=count+1
                else:
                    p[k]=random.uniform(xmin,xmax)
                    p[k+m]= random.uniform(ymin,ymax)

                if count==m*(m-1)/2:
                    Constraint_OK=True
                        
                    # print("==============j=")
                    # print(j)
                    # print("==============k=")
                    # print(k)
                    # print("=================")
                    # print(p)


    # Read in induction options
    Ind_Opts = fi.floris.farm.flow_field.Ind_Opts
    # Set induction to true to model blockage effect
    Ind_Opts['induction']= True
    Ind_Opts["Model"] = 'VC'
    Ind_Opts["Ground"]= True
    fi.IndOpts = Ind_Opts

    # Reinitialize flow field with new specified layout 初始化每顆粒子(初始化風場配置跟發電量)
    fi.reinitialize_flow_field(layout_array=[p[0:m], p[m:2*m]])
    AEP_sum=0
    for i in range(len(df.ws)):
        if df.freq_val[i] ==0 or df.ws[i]<3 or df.ws[i]>25 or df.wd[i]<0:
            continue
        # Reinitialize flow field with new specified layout
        fi.reinitialize_flow_field(wind_direction=df.wd[i], wind_speed=df.ws[i])

        # Calculate wake
        fi.calculate_wake(Ind_Opts=Ind_Opts)
        AEP_sum = AEP_sum + fi.get_farm_power()*df.freq_val[i]*8760
        # print("AEP_sum=")
        # print(AEP_sum) 
    # Get farm power in each particle (Fitness) 
    p[2*m] = AEP_sum
    # print("initial_p",idx)
    # print(p)
    return p

    

def update(p, pb, gb, v,minDist):

    #先更新X的速度然後更新X的位置
    for j in range(m):
        v[j]=w*v[j]+c1*random.random()*(pb[j]-p[j])+c2*random.random()*(gb[j]-p[j])
        if v[j]>0 and v[j]>xvmax:
            v[j]=xvmax
        elif v[j]<0 and v[j]<-xvmax:
            v[j]=-xvmax
        p[j]=p[j]+v[j]
        if p[j]>xmax or p[j]<xmin:
            p[j]=random.uniform(xmin,xmax)

    #根據Ｘ的位置，更新Y的速度，再更新Y的位置
    for j in range(m):
        v[j+m]=w*v[j+m]+c1*random.random()*(pb[j+m]-p[j+m])+c2*random.random()*(gb[j+m]-p[j+m])
        if v[j+m]>0 and v[j+m]>yvmax:
            v[j+m]=yvmax
        elif v[j+m]<0 and v[j+m]<-yvmax:
            v[j+m]=-yvmax
        p[j+m]=p[j+m]+v[j+m]
        if p[j+m]>ymax or p[j+m]<ymin:
            p[j+m]=random.uniform(ymin,ymax)

    Constraint_OK= False
    while Constraint_OK ==False:
        count=0
        for j in range(m-1): 
            for k in range(j+1,m): 
                ppp = p[j+m]-p[k+m]
                qqq = p[j]-p[k]
                if ppp**2+qqq**2 > minDist:
                    count=count+1
                else:               
                    v[k]=w*v[k]+c1*random.random()*(pb[k]-p[k])+c2*random.random()*(gb[k]-p[k])
                    if v[k]>0 and v[k]>xvmax:
                        v[k]=xvmax
                    elif v[k]<0 and v[k]<-xvmax:
                        v[k]=-xvmax
                    p[k]=p[k]+v[k]
                    if p[j]>xmax or p[j]<xmin:
                        p[j]=random.uniform(xmin,xmax)

                
                    v[k+m]=w*v[k+m]+c1*random.random()*(pb[k+m]-p[k+m])+c2*random.random()*(gb[k+m]-p[k+m])
                    if v[k+m]>0 and v[k+m]>yvmax:
                        v[k+m]=yvmax
                    elif v[k+m]<0 and v[k+m]<-yvmax:
                        v[k+m]=-yvmax
                    p[k+m]=p[k+m]+v[k+m]
                    if p[j+m]>ymax or p[j+m]<ymin:
                        p[j+m]=random.uniform(ymin,ymax)

                if count==m*(m-1)/2:
                    Constraint_OK=True
        # print(iteration,"update")
