    # Set induction to true to model blockage effect
    Ind_Opts['induction']=True
    Ind_Opts["Model"] = 'VC'
    Ind_Opts["Ground"]=True
    fi.IndOpts = Ind_Opts

    # Reinitialize flow field with new specified layout 初始化每顆粒子(初始化風場配置跟發電量)


    fi.reinitialize_flow_field(layout_array=[p[0:m], p[m:2*m]])
    AEP_sum=0
    for i in range(len(df.ws)):
        if df.freq_val[i] ==0 or df.ws[i]<3 or df.ws[i]>=25 or df.wd[i]<0:
            continue
        # Reinitialize flow field with new specified layout
        fi.reinitialize_flow_field(wind_direction=df.wd[i], wind_speed=df.ws[i])

        # Calculate wake
        fi.calculate_wake(Ind_Opts=Ind_Opts)
        AEP_sum = AEP_sum + fi.get_farm_power()*df.freq_val[i]*8760
        # print("AEP_sum=")
        # print(AEP_sum) 
        # print("================")
    # print(p)


    # Get farm power in each particle (Fitness) 
    p[2*m] = AEP_sum
    return p, v





